import React, {Component} from "react";
import {InputText} from "primereact/inputtext";

export class Rents extends Component {

    constructor(props) {
        super(props);
    }

    render() {

        return (
            <span className="p-float-label">
                <InputText id="in"/>
                <label htmlFor="in">Username</label>
            </span>

        );
    }
}

export default Rents;
